{
  "name": "UBX-CFG-ITFM",
  "class_id": "0x06",
  "message_id": "0x39",
  "description": "Jamming/interference monitor configuration",
  "message_type": "get_set",
  "payload_length": {
    "fixed": 8
  },
  "payload_fields": [
    {
      "byte_offset": 0,
      "name": "config",
      "data_type": "X4",
      "description": "Interference config word",
      "bitfields": [
        {
          "name": "enable",
          "bit_offset": 0,
          "num_bits": 1,
          "description": "Enable interference detection"
        },
        {
          "name": "algorithmBits",
          "bit_offset": 1,
          "num_bits": 7,
          "description": "Reserved algorithm settings - should be set to 0x16B156 in hex for correct settings"
        },
        {
          "name": "cwThreshold",
          "bit_offset": 8,
          "num_bits": 2,
          "description": "CW jamming detection threshold",
          "unit": "dB"
        },
        {
          "name": "bbThreshold",
          "bit_offset": 10,
          "num_bits": 2,
          "description": "Broadband jamming detection threshold",
          "unit": "dB"
        },
        {
          "name": "reserved1",
          "bit_offset": 12,
          "num_bits": 20,
          "reserved": true
        }
      ]
    },
    {
      "byte_offset": 4,
      "name": "config2",
      "data_type": "X4",
      "description": "Extra settings for jamming/interference monitor",
      "bitfields": [
        {
          "name": "generalBits",
          "bit_offset": 0,
          "num_bits": 12,
          "description": "General settings - should be set to 0x31E in hex for correct setting"
        },
        {
          "name": "antSetting",
          "bit_offset": 12,
          "num_bits": 2,
          "description": "Antenna setting, 0=unknown, 1=passive, 2=active"
        },
        {
          "name": "enable2",
          "bit_offset": 14,
          "num_bits": 1,
          "description": "Set to 1 to scan auxiliary bands (u-blox 8 /u-blox M8 only, otherwise ignored)"
        },
        {
          "name": "reserved2",
          "bit_offset": 15,
          "num_bits": 17,
          "reserved": true
        }
      ]
    }
  ]
}
